import React from 'react'
import './Header.scss'
import { motion } from 'framer-motion'

const Header = () => {
  return (
    <div className='container'>
      <motion.div
        className="box"
        animate={{
          scale: [1, 2, 2, 1, 1],
          rotate: [0, 0, 180, 180, 0],
          borderRadius: ["0%", "0%", "50%", "50%", "0%"]
        }}
        transition={{
          duration: 1.2,
          delay: 0.5,
          ease: [0, 0.71, 0.2, 1.01]
        }}
      />
    </div>
  )
}

export default Header
